const Greeting = () => {
  const MouseOver = () => {
    return (style = { color: "blue" });
  };

  return (
    <div>
      <h1
        className="animate__animated animate__bounce animate__pulse"
        onMouseOver={MouseOver()}
      >
        Hello!
      </h1>
      <p>lorem ipsum ...</p>
    </div>
  );
};

export default Greeting;
